import React from 'react';
import bitLogo from "../images/bitcourier-05.png";
import '../App.css';

const MediaPartner=()=> {

  return (
    <div className="media-partner" id="media-partner">
      <div className="media-header"> <h2> Media Partner</h2> </div>
      <div className="media-members">

     <div className="members-detail">
        <a target="_blank" rel="noreferrer" href="https://bitcourier.co.uk/"><img src="https://i.ibb.co/yFh2fJZ/bitcourier-05.png" alt="bitcourier"/></a> 
      </div>

      </div> 



    </div>
  );
}

export default MediaPartner;
